import React from "react";

const Testimonials = () => {
  return (
    <section className="py-16 text-center">
      <h2 className="text-4xl font-bold text-gray-800">What Our Users Say</h2>
      <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8 px-6">
        <div className="p-6 bg-gray-100 rounded-lg shadow-md">
          <img src="/assets/doctor.jpg" alt="Doctor" className="mx-auto w-16 rounded-full mb-4" />
          <p className="text-lg">"This platform has helped me consult patients easily."</p>
          <h3 className="font-bold mt-2">- Dr. John Doe</h3>
        </div>
        <div className="p-6 bg-gray-100 rounded-lg shadow-md">
          <img src="/assets/patient.jpg" alt="Patient" className="mx-auto w-16 rounded-full mb-4" />
          <p className="text-lg">"Booking doctor appointments has never been this easy!"</p>
          <h3 className="font-bold mt-2">- Jane Doe</h3>
        </div>
      </div>
    </section>
  );
};

export default Testimonials;
